export const quizData = [
  {
    id: 0,
    question: ` Which of the following is the correct way to initialize a new Git repository ?`,
    options: [`git add`, `git init`, `git push`],
    answer: `git init`
  },
  {
    id: 1,
    question: `How many elements does a react component return?`,
    options: [`1`, `2`, `multiple`],
    answer: `multiple`
  },
  {
    id: 3,
    question: ` How can you access the state of a component from inside of a member function?`,
    options: [`this.values`, `this.state`, `this.ReactDOM()`],
    answer: `this.values`
  },
  {
    id: 4,
    question: `Which of the following commands will stage your entire directory and every non-empty directory inside your current directory?`,
    options: [`git add .`, `git commit all`, `git status all`],
    answer: `git add .`
  }
];
